- (void)mouseReleasedWithRAREMouseEvent:(RAREMouseEvent *)e {
  RAREUIPoint *p = mousePressedPoint_;
  (void) [self evaluateWithNSString:[RAREiConstants EVENT_MOUSE_UP] withJavaUtilEventObject:e withBoolean:NO];
  if ([((RAREMouseEvent *) nil_chk(e)) isPopupTrigger] && [self isEnabledWithNSString:[RAREiConstants EVENT_CONTEXTMENU]]) {
    (void) [self evaluateWithNSString:[RAREiConstants EVENT_CONTEXTMENU] withJavaUtilEventObject:e withBoolean:NO];
  }
  else if ([e getClickCount] > 1) {
    if ([self isEnabledWithNSString:[RAREiConstants EVENT_DOUBLECLICK]]) {
      [self executeWithNSString:[RAREiConstants EVENT_DOUBLECLICK] withJavaUtilEventObject:e];
    }
  }
  else if ([self isEnabledWithNSString:[RAREiConstants EVENT_CLICK]]) {
    if ([RAREPlatform isTouchDevice] || [RAREaPlatformHelper isMouseClickWithRAREUIPoint:p withLong:mousePressedTime_ withRAREMouseEvent:e]) {
      [self executeWithNSString:[RAREiConstants EVENT_CLICK] withJavaUtilEventObject:e];
    }
  }
}

