- (void)propertyChangeWithJavaBeansPropertyChangeEvent:(JavaBeansPropertyChangeEvent *)e {
  id<JavaUtilMap> map = (id<JavaUtilMap>) check_protocol_cast(((eventMap_ == nil) ? nil : [eventMap_ getWithId:RAREaWidgetListener_EVENT_PROEPRTY_CHANGE_]), @protocol(JavaUtilMap));
  if (map == nil) {
    return;
  }
  NSString *event = [((JavaBeansPropertyChangeEvent *) nil_chk(e)) getPropertyName];
  id code = [map getWithId:event];
  NSString *type = [NSString stringWithFormat:@"propertyChange_%@", event];
  RAREWidgetContext *ctx = [((id<RAREiWidget>) nil_chk(theWidget_)) getScriptingContext];
  if (code != nil) {
    if ([code isKindOfClass:[NSString class]]) {
      code = [((id<RAREiScriptHandler>) nil_chk(scriptHandler_)) compileWithRAREWidgetContext:ctx withNSString:type withNSString:(NSString *) check_class_cast(code, [NSString class])];
      (void) [map putWithId:event withId:code];
    }
    RAREScriptingEvent *evt = [[RAREScriptingEvent alloc] initWithRAREiScriptHandler:scriptHandler_ withNSString:type withJavaUtilEventObject:e withId:theWidget_ withId:nil];
    (void) [((id<RAREiScriptHandler>) nil_chk(scriptHandler_)) evaluateWithRAREWidgetContext:ctx withId:code withRAREScriptingEvent:evt];
  }
}

- (id)removeEventHandlerWithNSString:(NSString *)event
                              withId:(id)code {
  if ((event != nil) && (eventMap_ != nil)) {
    if (![event hasPrefix:[RAREiConstants EVENT_PREFIX]]) {
      event = [NSString stringWithFormat:@"%@%@", [RAREiConstants EVENT_PREFIX], event];
    }
    id o = [eventMap_ removeWithId:event];
    if ((code != nil) && ([o isKindOfClass:[RAREMultiScript class]])) {
      RAREMultiScript *ms = (RAREMultiScript *) check_class_cast(o, [RAREMultiScript class]);
      [((RAREMultiScript *) nil_chk(ms)) removeWithId:code];
      if ([ms size] > 0) {
        (void) [eventMap_ putWithId:event withId:ms];
      }
      o = code;
    }
    return o;
  }
  return nil;
}

