- (id)setEventHandlerWithNSString:(NSString *)event
                           withId:(id)code
                      withBoolean:(BOOL)append {
  if ((event != nil) && (eventMap_ != nil)) {
    if (![event hasPrefix:[RAREiConstants EVENT_PREFIX]]) {
      event = [NSString stringWithFormat:@"%@%@", [RAREiConstants EVENT_PREFIX], event];
    }
    if ([event contains:@"onKey"]) {
      keyEventsEnabled_ = YES;
    }
    else if ([event contains:@"onMouseMoved"] || [event contains:@"onMouseDragged"]) {
      mouseMotionEventsEnabled_ = YES;
    }
    else if ([event contains:@"onMouse"] || [event contains:@"Click"]) {
      if (![event isEqual:[RAREiConstants EVENT_SCROLL]]) {
        mouseEventsEnabled_ = YES;
      }
    }
    else if ([event contains:@"onWill"]) {
      expansionEventsEnabled_ = YES;
    }
    else if ([event contains:@"onHas"]) {
      expandedEventsEnabled_ = YES;
    }
    else if ([event isEqual:[RAREiConstants EVENT_ACTION]]) {
      actionEventEnabled_ = YES;
    }
    else if ([event isEqual:[RAREiConstants EVENT_SCALE]]) {
      scaleEventsEnabled_ = YES;
    }
    else if ([event isEqual:[RAREiConstants EVENT_FLING]]) {
      mouseMotionEventsEnabled_ = YES;
    }
    if (eventMap_ == [JavaUtilCollections EMPTY_MAP]) {
      eventMap_ = [[JavaUtilHashMap alloc] init];
    }
    id o = [eventMap_ putWithId:event withId:code];
    if (append && (o != nil)) {
      RAREMultiScript *ms;
      if ([o isKindOfClass:[RAREMultiScript class]]) {
        ms = (RAREMultiScript *) check_class_cast(o, [RAREMultiScript class]);
      }
      else {
        ms = [[RAREMultiScript alloc] initWithNSString:event];
        [ms addWithId:o];
      }
      [((RAREMultiScript *) nil_chk(ms)) addWithId:code];
      (void) [eventMap_ putWithId:event withId:ms];
    }
  }
  return nil;
}

